import React from 'react'
import { MDBCard,MDBCardTitle, MDBCardText,MDBCardImage,MDBCardBody} from 'mdbreact';

export default function Home() {
    return (
<div className=" col-12 col-md-10 ">
  <button></button>
    <MDBCard style={{ width: "22rem" }}>
    <MDBCardImage className="img-fluid" src='../assets/react.png' waves />
    <MDBCardBody>  <button></button>

      <MDBCardTitle  className='row justify-content-center'>My Choose</MDBCardTitle>
      <MDBCardText >React is my envouierment </MDBCardText>

    </MDBCardBody>
  </MDBCard>

</div> 
    )
}
